#' Collect decay, waste and breakage factor in FIZ routine
#' 
#' 
#' @description This function is to collect the dead, waste and breakage factor from lookup table and 
#'              join them into tree data. Instead of reading the lookup table from disk, the function
#'              uses hard-coded the lookup table. This function is equivalent to second part of 
#'              dwb_fct.sas macro. For \code{BEC} routine, the decay, waste and breakage are collected using funtion
#'              \code{\link{DWBGenerator_BEC}}
#'
#' @param DBHClass numeric, Tree DBH class. Currently, The function is capatable to the DBH 
#'                          class with 5 cm interval. It can be derived using \code{\link{DBHClassifier}}.
#'                          
#' @param tabNumber character, This character consist of 4 numbers. The first two number is the species number,
#'                             and the last is the series number. 
#' 
#' @param riskGroup character, Specifies the risk group.  It must be one of \code{1}, \code{2} or \code{3}.
#'                             It can be derived from \code{\link{riskGroupDeriver}}.
#' 
#' @return A list of \code{decay}, \code{waste} and \code{breakage} percentage.
#' 
#' @importFrom data.table data.table
#'
#' 
#' @export
#' @docType methods
#' @rdname DWBGenerator_FIZ
#'
#' @author Yong Luo
#'
setGeneric("DWBGenerator_FIZ",
           function(DBHClass, tabNumber, riskGroup) {
             standardGeneric("DWBGenerator_FIZ")
           })

#' @rdname DWBGenerator_FIZ
setMethod(
  "DWBGenerator_FIZ",
  signature = c(DBHClass = "numeric",
                tabNumber = "character",
                riskGroup = "character"),
  definition = function(DBHClass, tabNumber, riskGroup){
    worktable <- data.table(uniObs = 1:length(tabNumber),
                            DBHClass, tabNumber, riskGroup)
    lookuptable <- getDWBFCTlookuptable()
    worktable <- merge(worktable, lookuptable, by = c("DBHClass", "tabNumber", "riskGroup"),
                       all.x = TRUE)
    ## for the observations that can not be assigned with DWB,
    # /* POSSIBLE ? RETURN INDICATES FLAT PORTION OF CURVE - NOT ALL POINTS INCLUDED IN TABLE */
    #   /* SO TRY WITH TOP GROUP - MODIFIED JULY 23/97 */
    #   
    #   IF _DWB_FCT EQ  '?' THEN DO;
    # _ARG_FCT= &TAB_NO !! &RISK_GRP !! '610';
    # _DWB_FCT= PUT ( _ARG_FCT , $DWB_FCT. );
    # END;
    worktableAssigned <- worktable[!is.na(decay)]
    worktableUnassigned <- worktable[is.na(decay)][, ':='(decay = NULL,
                                                          waste = NULL,
                                                          breakage = NULL)]
    worktableUnassigned[DBHClass %==% 5, DBHClass := 10]
    worktableUnassigned[DBHClass %!=% 10, DBHClass := 610]
    worktableUnassigned <- merge(worktableUnassigned, lookuptable, by = c("DBHClass", "tabNumber", "riskGroup"),
                                 all.x = TRUE)
    worktable <- rbind(worktableAssigned, worktableUnassigned)
    return(list(decay = worktable[order(uniObs)]$decay/10,
                waste = worktable[order(uniObs)]$waste/10,
                breakage = worktable[order(uniObs)]$breakage/10))
  })


